          text: `Cache Statistics:
- Total entries: ${stats.entryCount}
- Memory entries: ${stats.memoryEntries}
- Fresh: ${stats.freshCount}
- Stale: ${stats.staleCount}
- Expired: ${stats.expiredCount}`
